El Arte del Handcraft 

Hacer siropes es una gran manera de agregar profundidad de sabor y a la vez resaltar los otros ingredientes en la preparación de un cocktail. La elaboración de siropes propios permite experimentar con nuevos sabores y abaratar costos. 

La mejor manera de extraer y conservar el sabor de cualquier producto recién adquirido o fresco es con azúcar. En la cocina y en el bar, el azúcar es utilizada para extraer sabores de los ingredientes básicos. 

